import React, { useState } from 'react';
import { useCart } from '../context/CartContext';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const { getCartCount } = useCart();

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
      setIsOpen(false); // Close mobile menu after clicking
    }
  };

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
    setIsOpen(false);
  };

  return (
    <nav className="shadow-lg sticky top-0 z-50" style={{ backgroundColor: '#E6C9A2' }}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <button onClick={scrollToTop} className="flex items-center space-x-2">
            {/* Solid Brown Icons */}
            <div className="flex items-center space-x-1">
              {/* Cup Icon */}
              <div className="w-6 h-6 rounded-full flex items-center justify-center" style={{ backgroundColor: '#2C1810' }}>
                <svg width="14" height="14" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M2 21H22L20 19H4L2 21Z" fill="#E6C9A2"/>
                  <path d="M20 8H18V5C18 3.9 17.1 3 16 3H8C6.9 3 6 3.9 6 4V8H4C2.9 8 2 8.9 2 10V12C2 13.1 2.9 14 4 14H6V16C6 17.1 6.9 18 8 18H16C17.1 18 18 17.1 18 16V14H20C21.1 14 22 13.1 22 12V10C22 8.9 21.1 8 20 8Z" fill="#E6C9A2"/>
                </svg>
              </div>

              {/* Cart Icon */}
              <div className="w-6 h-6 rounded-full flex items-center justify-center" style={{ backgroundColor: '#2C1810' }}>
                <svg width="14" height="14" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M7 18C5.9 18 5.01 18.9 5.01 20S5.9 22 7 22 9 21.1 9 20 8.1 18 7 18ZM1 2V4H3L6.6 11.59L5.25 14.04C5.09 14.32 5 14.65 5 15C5 16.1 5.9 17 7 17H19V15H7.42C7.28 15 7.17 14.89 7.17 14.75L7.2 14.63L8.1 13H15.55C16.3 13 16.96 12.59 17.3 11.97L20.88 5H5.21L4.27 3H1V2Z" fill="#E6C9A2"/>
                  <path d="M17 18C15.9 18 15.01 18.9 15.01 20S15.9 22 17 22 19 21.1 19 20 18.1 18 17 18Z" fill="#E6C9A2"/>
                </svg>
              </div>

              {/* Login Icon */}
              <div className="w-6 h-6 rounded-full flex items-center justify-center" style={{ backgroundColor: '#2C1810' }}>
                <svg width="14" height="14" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M12 12C14.21 12 16 10.21 16 8C16 5.79 14.21 4 12 4C9.79 4 8 5.79 8 8C8 10.21 9.79 12 12 12ZM12 14C9.33 14 4 15.34 4 18V20H20V18C20 15.34 14.67 14 12 14Z" fill="#E6C9A2"/>
                </svg>
              </div>
            </div>

            <span className="font-playfair text-2xl font-bold text-coffee-brown">
              EstateDeli
            </span>
          </button>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <button 
              onClick={scrollToTop}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Home
            </button>
            <button 
              onClick={() => scrollToSection('about')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              About
            </button>
            <button 
              onClick={() => scrollToSection('menu')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Menu
            </button>
            <button 
              onClick={() => scrollToSection('shop')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Shop
            </button>
            <button 
              onClick={() => scrollToSection('contact')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Contact
            </button>
          </div>

          {/* Right side - Cart and Login */}
          <div className="flex items-center space-x-4">
            {/* Cart Icon */}
            <button className="relative p-2 text-coffee-brown hover:text-coffee-dark transition-colors">
              <span className="text-xl">ðŸ›’</span>
              {getCartCount() > 0 && (
                <span className="absolute -top-1 -right-1 bg-coffee-brown text-white text-xs rounded-full h-5 w-5 flex items-center justify-center">
                  {getCartCount()}
                </span>
              )}
            </button>

            {/* Login Button */}
            <button className="bg-transparent border-2 border-coffee-brown text-coffee-brown px-4 py-2 rounded-lg hover:bg-coffee-brown hover:text-white transition-all duration-500 font-medium shadow-md hover:shadow-lg transform hover:scale-105 text-sm">
              Login
            </button>

            {/* Mobile menu button */}
            <button 
              className="md:hidden p-2"
              onClick={() => setIsOpen(!isOpen)}
            >
              <div className="w-6 h-6 flex flex-col justify-center items-center">
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? 'rotate-45 translate-y-1' : '-translate-y-0.5'}`}></span>
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm my-0.5 ${isOpen ? 'opacity-0' : 'opacity-100'}`}></span>
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? '-rotate-45 -translate-y-1' : 'translate-y-0.5'}`}></span>
              </div>
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        <div className={`md:hidden ${isOpen ? 'block' : 'hidden'}`}>
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3" style={{ backgroundColor: '#E6C9A2' }}>
            <button 
              onClick={scrollToTop}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Home
            </button>
            <button 
              onClick={() => scrollToSection('about')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              About
            </button>
            <button 
              onClick={() => scrollToSection('menu')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Menu
            </button>
            <button 
              onClick={() => scrollToSection('shop')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Shop
            </button>
            <button 
              onClick={() => scrollToSection('contact')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Contact
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
